import { Container,Button } from "react-bootstrap";
import Input from "./Input.js";

import Topbar from "./Topbar";

import {Row, Col } from "react-bootstrap";
export default function CenterSubject() {
  return (
    <>
      <Topbar />
      <Container className="text-center">
        <Input placehold="বইয়ের নাম" h="6px" />

        <Input placehold="সুরার নাম" h="5px" />
        <Input placehold="সুরার নাম্বার" h="6px" />
        <Input placehold="আয়াত নাম্বার" h="5px" />
        <Input placehold="আয়াত বাংলা ,আরকি" h="165px" />
        <Input placehold="সারসংক্ষেপ" h="295px" />
        <Input placehold="আনুসঞ্জিক বিষয়" h="295px" />

        <Input placehold="লেখকের পরিচিতি" h="295px" />
        <Input placehold="ওহির তাৎর্পয়" h="295px" />
        <Input placehold="কোরআন নাজিলের ইতিহাস" h="295px" />
        <Input placehold="কোরআন সংরক্ষনের ইতিহাস" h="295px" />
        <Input placehold="তাফসির সম্পর্কে ভুল ধারণা" h="295px" />
        <div className="d-grid gap-2">
          <Button variant="secondary" size="lg">
            Block level button
          </Button>
        </div>
      </Container>
    </>
  );
}
